import React, { useEffect, useState } from "react";
import "./App.css";

function App() {
  const [indicadores, setIndicadores] = useState([]);

  useEffect(() => {
    fetch("http://localhost:3000/api/indicadores")
      .then((res) => res.json())
      .then((data) => setIndicadores(data))
      .catch((err) => console.error(err));
  }, []);

  return (
    <div className="App">
      <h1>Indicadores de Salud</h1>
      <table>
        <thead>
          <tr>
            <th>Código</th>
            <th>Nombre</th>
            <th>Unidad</th>
            <th>Descripción</th>
          </tr>
        </thead>
        <tbody>
          {indicadores.map((ind) => (
            <tr key={ind.id_indicador}>
              <td>{ind.codigo_indicador}</td>
              <td>{ind.nombre_indicador}</td>
              <td>{ind.unidad_medida}</td>
              <td>{ind.descripcion}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
